import React from 'react';

function TeamCard({ teamName, playerScores }) {
  return (
    <div className="team-card">
      <h2>{teamName}</h2>
      <ul>
        {playerScores.map((player) => (
          <li key={player.id}>{player.name}: {player.score}</li>
        ))}
      </ul>
    </div>
  );
}

export default TeamCard;
